import React from "react"; 
import { Link } from "react-router-dom";

let menuItems = [
    {
        title: "Home",
        link: "/", 
    },

    {
        title: "Join",
        link: "/user"
    }, 

    {
        title: "Contact Us",
        link: "/contact"
    }
  ];

const CreateMenu = () => {

    return (
        <div>
            <img src="mesofunny/src/download.png" onClick={() => document.querySelector("menu").classList.toggle("menu--open")} />
            <div className="menu">
                <ul>
                    {
                    // iterate through given menuArray 
                    menuItems.map((item) => {
                       return <li><Link to={item.link}>{item}</Link></li>
                    })
                    }
                </ul>
            </div>
        </div>
    )
}

export default CreateMenu;
